"use strict";(self.webpackChunkai_book_hackathon=self.webpackChunkai_book_hackathon||[]).push([[158],{1550:i=>{i.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"category","label":"dedication","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/AI_book_hacakthon/docs/dedication/dedication","label":"Dedication","docId":"dedication/dedication","unlisted":false}]},{"type":"category","label":"Physical AI","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/AI_book_hacakthon/docs/physical-ai/chapter-1-introduction-to-physical-ai","label":"Chapter 1: Introduction to Physical AI","docId":"physical-ai/chapter-1-introduction-to-physical-ai","unlisted":false},{"type":"link","href":"/AI_book_hacakthon/docs/physical-ai/chapter-2-key-technologies-in-physical-ai","label":"Chapter 2: Key Technologies in Physical AI","docId":"physical-ai/chapter-2-key-technologies-in-physical-ai","unlisted":false},{"type":"link","href":"/AI_book_hacakthon/docs/physical-ai/chapter-3-challenges-and-ethical-considerations","label":"Chapter 3: Challenges and Ethical Considerations in Physical AI","docId":"physical-ai/chapter-3-challenges-and-ethical-considerations","unlisted":false},{"type":"link","href":"/AI_book_hacakthon/docs/physical-ai/chapter-4-future-directions-in-physical-ai","label":"Chapter 4: Future Directions in Physical AI","docId":"physical-ai/chapter-4-future-directions-in-physical-ai","unlisted":false}],"href":"/AI_book_hacakthon/docs/category/physical-ai"},{"type":"category","label":"introduction-to-book","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/AI_book_hacakthon/docs/introduction-to-book/intro","label":"intro","docId":"introduction-to-book/intro","unlisted":false}]},{"type":"category","label":"Humanoid Robotics","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/AI_book_hacakthon/docs/humanoid-robotics/chapter-1-basics","label":"Basics of Humanoid Robotics","docId":"humanoid-robotics/chapter-1-basics","unlisted":false},{"type":"link","href":"/AI_book_hacakthon/docs/humanoid-robotics/chapter-2-introduction-to-humanoid-robotics","label":"Chapter 1: Introduction to Humanoid Robotics","docId":"humanoid-robotics/chapter-2-introduction-to-humanoid-robotics","unlisted":false},{"type":"link","href":"/AI_book_hacakthon/docs/humanoid-robotics/chapter-3-locomotion-and-balance","label":"Chapter 2: Locomotion and Balance in Humanoid Robots","docId":"humanoid-robotics/chapter-3-locomotion-and-balance","unlisted":false},{"type":"link","href":"/AI_book_hacakthon/docs/humanoid-robotics/chapter-4-future-and-ethical-implications","label":"Chapter 4: Future and Ethical Implications of Humanoid Robotics","docId":"humanoid-robotics/chapter-4-future-and-ethical-implications","unlisted":false},{"type":"link","href":"/AI_book_hacakthon/docs/humanoid-robotics/chapter-5-manipulation-and-interaction","label":"Chapter 3: Manipulation and Interaction in Humanoid Robots","docId":"humanoid-robotics/chapter-5-manipulation-and-interaction","unlisted":false}],"href":"/AI_book_hacakthon/docs/category/humanoid-robotics"}]},"docs":{"dedication/dedication":{"id":"dedication/dedication","title":"Dedication","description":"Dedicated to Sir Ziaullah Khan,","sidebar":"tutorialSidebar"},"humanoid-robotics/chapter-1-basics":{"id":"humanoid-robotics/chapter-1-basics","title":"Basics of Humanoid Robotics","description":"This chapter delves into the fundamentals of humanoid robotics, covering their design, locomotion, and control systems.","sidebar":"tutorialSidebar"},"humanoid-robotics/chapter-2-introduction-to-humanoid-robotics":{"id":"humanoid-robotics/chapter-2-introduction-to-humanoid-robotics","title":"Chapter 1: Introduction to Humanoid Robotics","description":"Humanoid robotics is a fascinating and complex field dedicated to creating robots that mimic the human form and often, human-like behaviors. These robots are designed to interact with environments built for humans, using tools and navigating spaces in a way that is intuitive to us. The pursuit of humanoid robots is driven by both scientific curiosity and practical applications, aiming to develop machines capable of assisting in diverse settings from homes and hospitals to disaster zones and outer space.","sidebar":"tutorialSidebar"},"humanoid-robotics/chapter-3-locomotion-and-balance":{"id":"humanoid-robotics/chapter-3-locomotion-and-balance","title":"Chapter 2: Locomotion and Balance in Humanoid Robots","description":"One of the most defining and challenging aspects of humanoid robotics is achieving stable and versatile bipedal locomotion. Unlike wheeled robots, humanoids must continuously maintain balance while moving, navigating uneven terrain, and interacting with their environment. This involves complex control strategies that mimic the biomechanics of human walking.","sidebar":"tutorialSidebar"},"humanoid-robotics/chapter-4-future-and-ethical-implications":{"id":"humanoid-robotics/chapter-4-future-and-ethical-implications","title":"Chapter 4: Future and Ethical Implications of Humanoid Robotics","description":"The future of humanoid robotics is poised for rapid evolution, promising to redefine human-machine interaction and societal structures. However, this progress also necessitates a deep dive into the ethical and societal implications to ensure responsible development and deployment.","sidebar":"tutorialSidebar"},"humanoid-robotics/chapter-5-manipulation-and-interaction":{"id":"humanoid-robotics/chapter-5-manipulation-and-interaction","title":"Chapter 3: Manipulation and Interaction in Humanoid Robots","description":"Beyond locomotion, the ability of humanoid robots to interact with their environment through manipulation is critical for their practical utility. This involves complex tasks like grasping objects, using tools, and engaging in physical collaboration with humans. Replicating the dexterity and versatility of human hands and arms is a significant challenge.","sidebar":"tutorialSidebar"},"introduction-to-book/intro":{"id":"introduction-to-book/intro","title":"intro","description":"Introduction to PhysicalAI and Humanoid Robotics","sidebar":"tutorialSidebar"},"physical-ai/chapter-1-introduction-to-physical-ai":{"id":"physical-ai/chapter-1-introduction-to-physical-ai","title":"Chapter 1: Introduction to Physical AI","description":"Physical AI represents the convergence of artificial intelligence with robotic systems, enabling machines to perceive, reason, and act within the physical world. Unlike purely software-based AI, physical AI embodies intelligence in tangible forms, allowing for direct interaction with environments and manipulation of objects. This field is rapidly advancing, driven by breakthroughs in robotics, machine learning, computer vision, and sensor technologies.","sidebar":"tutorialSidebar"},"physical-ai/chapter-2-key-technologies-in-physical-ai":{"id":"physical-ai/chapter-2-key-technologies-in-physical-ai","title":"Chapter 2: Key Technologies in Physical AI","description":"Developing robust physical AI systems relies on a synergy of advanced technologies. These technologies collectively enable robots to understand their surroundings, make intelligent decisions, and execute complex tasks with precision and adaptability.","sidebar":"tutorialSidebar"},"physical-ai/chapter-3-challenges-and-ethical-considerations":{"id":"physical-ai/chapter-3-challenges-and-ethical-considerations","title":"Chapter 3: Challenges and Ethical Considerations in Physical AI","description":"While the potential of Physical AI is immense, its development and deployment come with significant challenges and ethical considerations that must be carefully addressed. Overcoming these hurdles is crucial for the responsible and beneficial integration of physical AI into society.","sidebar":"tutorialSidebar"},"physical-ai/chapter-4-future-directions-in-physical-ai":{"id":"physical-ai/chapter-4-future-directions-in-physical-ai","title":"Chapter 4: Future Directions in Physical AI","description":"The field of Physical AI is on the cusp of transformative advancements, with ongoing research pushing the boundaries of what autonomous systems can achieve in the physical world. Several key areas are expected to drive significant progress in the coming years.","sidebar":"tutorialSidebar"}}}}')}}]);